import HeroSection  from '../HeroSection';
import { workObjOne } from '../HomePage/Data';


function Joul() {
    return (
        <>
        <div>
        <HeroSection {...workObjOne} />
        <WorkTitle {...WorkOne} />
        </div>
        <div className="container">
            <span className="question">How might children explore about sustainability by themselves,but not being taught?</span>
        </div>
        </>
    );
}

export default Joul;
